const initialState = {
    data: null,
    include: {},
    total: 0,
    quantity_income: 0,
    quantity_expense: 0,
    amount_income: 0,
    amount_expense: 0
  }

  export default function (state = initialState, action) {
    const { type, payload } = action;
    switch (type) {
      case "GET_ITEM":
        return {
          ...state,
          data: payload.data,
          include: payload.included,
          total: payload.total,
          quantity_expense: payload.quantity_expense,
          quantity_income: payload.quantity_income,
          amount_income: payload.amount_income,
          amount_expense: payload.amount_expense
        };
